import axios from 'axios';
import { SignUp } from 'components';
import React, { useState } from 'react';
const Component = () => {
    const [showAlert, setShowAlert] = useState({ status: false, message: '' })
    const onSubmit = async (data, e) => {

        if (data.password === data.passwordValidate) {

            const res = await axios.post('localhost:4006/autenticacion/registro', data);
            if (res.status !== 200) {
                return setShowAlert({ stauts: true, message: res.data.message })
            }
            e.target.reset()
            return window.location.href = "/login"
        }

        return setShowAlert({ stauts: true, message: "Las contraseñas no coinciden" })
    }
    return (

        <SignUp onSubmit={onSubmit} showAlert={showAlert} setShowAlert={setShowAlert} />
    );
}

export default Component;
